import React,{ Component} from 'react';

class List extends Component{
    constructor(props){
      super(props);
    }

    render(){
        return (
          <div className="List">
            {this.props.list.map((l)=> {
                <SearchList text = {l}/>
            })}
          </div>
        );
    }

}

const SearchList = ({text}) =>{
    <div>
        <li>{text}</li>
    </div>
}

export default List;
